pragma solidity ^0.5.0;

contract Kltstore {
    string public store;
    uint public productCounter = 0;
    mapping(uint => Product) public products;

// struct of the product
     struct Product {
        uint id;
        string name;
        string category;
        uint price;
        address payable owner;
        bool purchased;
    }

     event ProductCreated(
        uint id,
        string name,
         string category,
        uint price,
        address payable owner,
        bool purchased
    );

event ProductPurchased(
        uint id,
        string name,
         string category,
        uint price,
        address payable owner,
        bool purchased
    );

constructor() public {
        store = "Dapp Kltstore ";
    }
// create a product
        function createProduct(string memory _name, string memory _category, uint _price) public {
        // Require a valid name & category
        require(bytes(_name).length > 0);
         require(bytes(_category).length > 0);
        // Require a valid price
        require(_price > 0);
        // Increment product count
        productCounter ++;
        // Create the product
        products[productCounter] = Product(productCounter, _name, _category,  _price, msg.sender, false);
        // Trigger an event
        emit ProductCreated(productCounter, _name, _category,  _price, msg.sender, false);
    }

function purchaseProduct(uint _id) public payable {
    // Fetch the product
    Product memory _product = products[_id];
    // Fetch the owner
    address payable _seller = _product.owner;
    // Make sure the product has a valid id
    require(_product.id > 0 && _product.id <= productCounter);
    // Require that there is enough Ether in the transaction
    require(msg.value >= _product.price);
    // Require that the product has not been purchased already
    require(!_product.purchased);
    // Require that the buyer is not the seller
    require(_seller != msg.sender);
    // Transfer ownership to the buyer
    _product.owner = msg.sender;
    // Mark as purchased
    _product.purchased = true;
    // Update the product
    products[_id] = _product;
    // Pay the seller by sending them Ether
    address(_seller).transfer(msg.value);
    // Trigger an event
    emit ProductPurchased(productCounter, _product.name, _product.category, _product.price, msg.sender, true);
}


}
